import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <section class="couner-container">
          <p>0</p>
          <div>
          <button>+</button>
          <button>-</button>
        </div>
        </section>
      </header>
    </div>
  );
}

export default App;
